import React from "react";
import bookjourney from "../components/BookJourney";
import "../styles/Book.css";
import { Link } from "react-router-dom";


function Book() {
  return (
    <div className="book">
      <Link to="/bookjourney">
        <button> BookItem </button>
      </Link>
    </div>
  );
}

export default Book;
